import DashCourseTile from "../componets/DashCourseTile";
import AddIcon from '@mui/icons-material/Add';




const Dashboard =()=>{
    return(
        <div className="DASHBOARD  " >
            <h2 className="ml-4 my-4 text-xl font-bold">Dashboard</h2>
            <div className="flex border rounded-xl   ">
               <DashCourseTile/>
               <DashCourseTile/>
               <DashCourseTile/>
            </div>
            <div className="flex justify-between items-center">
                <h2 className="ml-4 my-4 text-xl font-bold">Your Courses</h2>  <sapn className="ml-6 my-4 text-xs font-bold"> <AddIcon/> Add course</sapn>
            </div>
            
            <div className="flex border rounded-xl   ">
                <DashCourseTile/>
                <DashCourseTile/>
                <DashCourseTile/>
            </div>
                
            
        </div>
    )
}

export default Dashboard;
